import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const Program = () => {
  const { id } = useParams();
  const [program, setProgram] = useState({});
  const [program2, setProgram2] = useState([]);
  useEffect(() => {
    fetch(`https://api.github.com/users/${id}`)
    .then(response=> response.json())
    .then(data=> setProgram(data) )
    fetch(`https://api.github.com/users/${id}/repos`)
    .then(response=> response.json())
    .then(data=> setProgram2(data) )
  }, [id]);
console.log(program);
console.log(program2);
  return (
    <div>
        <div style={{boxSizing:"border-box", display:"block", 
        backgroundColor:"#EEF2FF", width:"100%"}}>

          <div style={{boxSizing:"border-box",display:"inline-block", width:"300px"}}>
          <img src={program.avatar_url} alt="User " 
          style={{borderRadius:"50%", height:"150px", width:"150px"}}/>
          <a href="program.html_url">{program.html_url}</a>
          </div>

          <div style={{boxSizing:"border-box",display:"inline-block"}}>
          <p>{program.login}</p>
          <p>{program.bio}</p> 
          <p>{program.location}</p>
          <p>{program.twitter_username}</p>
          </div>
          </div>
          {
            program2.map((el)=>{
              return <p>{JSON.stringify(el.name)}</p>
            })
          }
        
        </div>
  );
};
export default Program;
